import styled from '@emotion/styled'

function Header() {
    return(
        <HeaderStyled>
            <div className = "container">
                <div className = "logo">
                    CodeBoard
                </div>
            </div>
        </HeaderStyled>
    )
}

const HeaderStyled = styled.header`
    background: ${props => props.theme.colors.primary};
`

export default Header
